import React from "react";

const MenomineeRedesign = () => {
  return (
    <div>
      <div className="workLanding">
        <h1 className="top">MenomineeRedesign</h1>
      </div>
      <h1>Menominee Redesign</h1>
      <hr style={{ width: "84vw" }} />

      <h2>Overview</h2>
      <hr style={{ width: "76vw" }} />

      <h2>Context/Problem</h2>
      <hr style={{ width: "76vw" }} />

      <h2>Research</h2>
      <hr style={{ width: "76vw" }} />

      <h2>Process</h2>
      <hr style={{ width: "76vw" }} />

      <h2>Solution</h2>
      <hr style={{ width: "876vw" }} />

      <h2>Key Takeaways</h2>
    </div>
  );
};

export default MenomineeRedesign;
